const amplifierMap = {
  A: 12, // chimneys
  B: 1, // sky
  C: 10, // windows
  D: 5, // La dfense
  E: 6, // Les halles
  F: 10, // Le Louvre
  G: 1,
  H: 1,
  I: 1,
  J: 1,
  K: 1,
  L: 1,
  M: 1,
  N: 1,
  O: 1,
  P: 1,
  Q: 1,
  R: 1,
  S: 1,
  T: 1,
  U: 1,
} as const;

export const getAmplifier = ({ x, y }: { x: number; y: number }): number => {
  const yIndex = Math.floor(y / 10);
  if (yIndex >= zones.length) return 1;
  const row = zones[Math.floor(y / 10)];
  if (!row) return 1;
  const xIndex = Math.floor(x / 10);
  if (xIndex >= row.length) return 1;
  const letter = row[xIndex];
  return letter in amplifierMap ? amplifierMap[letter as keyof typeof amplifierMap] : 1;
};
